import React, { useState } from 'react';

const Creatures = ({creaturesList}) => {
    var [active, setActive] = useState(true)
    return ( 
        <div className="wrapper">
            <a href="/#" className={active ? 'active':''}>Creatures: Food</a>
            <a href="/#" className={active ? 'active':'active'}>Creatures: Non Food</a>
        <div className="creatures">
            {creaturesList.food.map(creature =>
                <div className="creature-item">
                    <h1>{creature.name.toUpperCase()}</h1>
                    <img src={creature.image} alt={creature.name} />
                    <p>{creature.description}</p>
                </div>
            )}
        </div>
        </div>
    );
}

export default Creatures;
